import React from 'react';
import './App.css';
import Header from "./Components/header"

const user= {
  name: 'Pranjal Singh',
  age: 18,
  location: 'India'
  }
  function App() {
  return (
  <div className="App">
  <h1>Hello, {user.name}</h1>
  <h2>Age: {user.age}</h2>
  <h2>Location: {user.location}</h2>
  </div>
  );
};

function MyButton() {
  return (
    <button>
      I'm a button
    </button>
  );
}

export default function MyApp() {
  return (
    <div>
      <h1>Welcome to my app</h1>
      <p>Here is a button</p>
      <Header />
      <MyButton />
      <App />

    </div>
  );
  }

